import React, { useState } from 'react';
import './navbar.css';  
import { NavLink, useNavigate } from 'react-router-dom';

const Navbar = ({ onLogout, overdueCount }) => {
  const [menuOpen, setMenuOpen] = useState(false); // To control toggle
  const navigate = useNavigate();
  const username = sessionStorage.getItem('username');

  const handleLogout = () => {
    sessionStorage.removeItem('access_token');
    sessionStorage.removeItem('username');
    onLogout(); 
    navigate('/login');
  };

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  return (
    <nav className="navbar">
      <h2 className="logo"><span className='logo-one'>Fresh</span>Finds</h2>

      {/* Hamburger Menu Icon */}
      <div className="hamburger" onClick={toggleMenu}>
        <div className="line"></div>
        <div className="line"></div>
        <div className="line"></div>
      </div>

      {/* Center links */}
      <ul className={`nav-links center-links ${menuOpen ? "open" : ""}`}>
        <li>
          <NavLink to="/" className={({ isActive }) => isActive ? "active" : ""} onClick={() => setMenuOpen(false)}>Home</NavLink>
        </li>
        <li>
          <NavLink to="/weather" className={({ isActive }) => isActive ? "active" : ""} onClick={() => setMenuOpen(false)}>Weather</NavLink>
        </li>
        <li>
          <NavLink to="/tasklist" className={({ isActive }) => isActive ? "active" : ""} onClick={() => setMenuOpen(false)}>
            TaskList
            {overdueCount > 0 && (
              <span className="notification-badge">{overdueCount}</span>
            )}
          </NavLink>
        </li>
        <li>
          <NavLink to="/predict" className={({ isActive }) => isActive ? "active" : ""} onClick={() => setMenuOpen(false)}>Disease Prediction</NavLink>
        </li>
        <li>
          <NavLink to="/recommend-crop" className={({ isActive }) => isActive ? "active" : ""} onClick={() => setMenuOpen(false)}>Crop Recommendation</NavLink>
        </li>
        <li>
          <NavLink to="/crop-feature" className={({ isActive }) => isActive ? "active" : ""} onClick={() => setMenuOpen(false)}>Crop Features</NavLink>
        </li>
        <li>
          <NavLink to="/vendors" className={({ isActive }) => isActive ? "active" : ""} onClick={() => setMenuOpen(false)}>Vendors</NavLink>
        </li>
        <li><a href="/contact" onClick={() => setMenuOpen(false)}>Contact</a></li>
      </ul>

      {/* Right side (Logout and Username) */}
      <ul className={`nav-links right-links ${menuOpen ? "open" : ""}`}>
        <li><button onClick={handleLogout} className="logout-btn">Logout</button></li>
        {username && <li className="username-display">Hi, {username}</li>}
      </ul>
    </nav>
  );
};

export default Navbar;
